import React from 'react'
//import * as Util from '../../../controller/util.js';

const JanelaNeon = props => {
      // console.log('Rodando /moJanela/JanelaEscuro');
      //Layout escuro
      return (
        <div>
          <div className="winDetal1 winDetalD1"></div>
          <div className="winDetal2 winDetalD2"></div>
          <div className="JanelaNeon">
          <div className="JanelaNeonDetail3"></div>
          {props.children}
          </div>
          <div className="winDetal1 winDetalE"></div>
          <div className="winDetal2 winDetalE"></div>
          <div className="JanelaNeonDetail4"></div>
          <style jsx>{`
                    .winDetal1 {
                      background-color:#00ffea;

                      border-top: solid 1px #00ffea;

                      /*border-right: solid 20px #00ffea;*/
                      /*border-left: solid 2px #00ffea;*/

                      border-top-right-radius: 4px;
                      border-top-left-radius: 4px;

                      width: 50px;
                      height: 5px;
                    }
                    .winDetal2 {
                      float: right;
                      border-top: solid 1px #00ffea;
                      border-left: solid 2px #00ffea;
                      border-top-left-radius: 4px;

                      width: 80%;

                      height: 3px;
                    }
          .winDetalD1 {
            float: right;
            margin-right: -22px;
            margin-top: -5px;
          }
          .winDetalD2 {
            float: right;
            margin-right: -22px;
            margin-top: -3px;
          }
          .winDetalE {
            margin-top: -5px;

          }
          .JanelaNeonDetail3 {
            border-bottom: solid 1px #00ffea;
            border-right: solid 2px #00ffea;
            border-left: solid 2px #00ffea;
            border-bottom-right-radius: 4px;
            border-bottom-left-radius: 4px;

            width: 50%;
            margin-left: 25%;
            height: 3px;
          }
          .JanelaNeon{
            width: 100%;
            font-size: 17px;
            font-family: sans-serif;

            color: #ffffff;

            background-color:#00ffea;
            background: rgba(0, 255, 255, 0.2);

            border-bottom-right-radius: 8px;
            border-top-left-radius: 8px;
            border: solid 1px #00ffea;
            padding: 10px;        
          }
          `}</style>
        </div>
      )
    }

    export default JanelaNeon
